import React from "react"

const EmptyThreadInfoBox = (props) => {
	// the container div should have the contents inside stack vertically
	return (
		<div className="w-full md:max-w-2xl lg:max-w-3xl md:h-full md:flex md:flex-col p-5 bg-white rounded-lg">
			<div className="flex gap-5 items-center m-auto text-lg font-bold md:flex-col md:gap-2">
				{/* add a circule purple background */}
				<div className="w-10 h-10 rounded-full bg-purple-50 flex items-center justify-center">
					<div className="w-8 h-8 rounded-full bg-purple-100 flex items-center justify-center">
						<img src={props.icon} alt="Your SVG" />
					</div>
				</div>
				{props.title}
			</div>
			<ul className="flex flex-col gap-3.5 w-full sm:max-w-md m-auto">
				{/* add captaion font */}

				<li className="w-full text-slate-500 text-sm rounded-md p-1">
					{props.text1}
				</li>
				<li className="w-full text-slate-500 text-sm rounded-md p-1">
					{props.text2}
				</li>
				<li className="w-full text-slate-500 text-sm rounded-md p-1">
					{props.text3}
				</li>
			</ul>
		</div>
	)
}

export default EmptyThreadInfoBox
